import React, { Component } from 'react'
import { Link } from 'react-router-dom'

import { Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink } from 'reactstrap';
import { withRouter } from "react-router";

class Footer extends Component {
	render(){ 
		return (<div id="footer">
			This is the footer yo!.
			<p>This site is in no way affiliated with any of the companies or brands listed.</p>
			<p>Information provided by the <a href="https://data.lcb.wa.gov/" target="_blank">Washington State Liquor and Cannabis Control Board</a> API and is only as up-to-date as the provided date.</p>
		</div>)
	}
}

export default Footer;
